import React from 'react'
import styles from './SlideShow.module.scss'

console.log(styles)

const SlideShow = ({ children, showElements }) => {
  document.getElementById(styles.root)
  return (
    <div id={ styles.root }>
      <div className={ styles.container }>
        { children }
      </div>
    </div>
  )
}

export default SlideShow
